import React from 'react';
import Calculate from './calculate';
import Select from 'react-select'


class TableRow extends React.Component {

    constructor(props) {
        super(props);
        this.state = {type1: '0', type2: '0'}

        this.handleChange = this.handleChange.bind(this)
    }

    handleChange(event) {
        this.setState({
            ...this.state,
            [event.target.name]: event.target.value
        });
    }

    render() {
        return (
                    <tr>
                    <td>
                        <Select options={    options = [
                            { value: "0", label: 'None' }, 
                            { value: "1", label: 'Normal' }, 
                            { value: "2", label: 'Fire' }, 
                            { value: "3", label: 'Water' }, 
                            { value: "4", label: 'Electric' }, 
                            { value: "5", label: 'Grass' }, 
                            { value: "6", label: 'Ice' }, 
                            { value: "7", label: 'Fighting' }, 
                            { value: "8", label: 'Poison' }, 
                            { value: "9", label: 'Ground' }, 
                            { value: "10", label: 'Flying' }, 
                            { value: "11", label: 'Psychic' }, 
                            { value: "12", label: 'Bug' }, 
                            { value: "13", label: 'Rock' }, 
                            { value: "14", label: 'Ghost' }, 
                            { value: "15", label: 'Dragon' }, 
                            { value: "16", label: 'Dark' }, 
                            { value: "17", label: 'Steel' }, 
                            { value: "18", label: 'Fairy' }
                        ]} />
                    </td>
                    <td>Ground, Water, Grass</td>
                    <td>Fire, Ghost</td>
                    </tr>
        );
    }
};

export default TableRow;
